    [],nt"num_tags": 3,nt"name": "back-bay-national-wildlife-refuge-refuge-narrative-report-may-august-1956",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Back Bay NWR
    outlines Refuge accomplishments from May through August of 1956. The report begins
    by summarizing the weather conditions, water conditions, and food and cover during
    this period. Wildlife- including migratory birds, upland game birds, furbearers,
    predators, rodents, mammals, and fish- is also covered. The Refuge development and
    maintenance section discusses physical developments, plantings, and collections
    and receipts. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, and fishing. N-R forms are attached.",nt"owner_org":
